export default (arr, sortBy) => {
  return arr
    .map(i => {
      const date = i[sortBy];
      i[date] =
        i[date] === undefined || i[date] === null ? '' : i[date].slice(0, 4);
      return { ...i, date };
    })
    .sort((a, b) => b.date - a.date)
    .reduce((acc, obj) => {
      let key = obj[date];
      if (!acc[key]) {
        acc[key] = [];
      }
      acc[key].push(obj);
      return acc;
    }, []);
};
